import "./App.css";
import "./bootstrap.css";
import {BrowserRouter, Routes, Route} from "react-router-dom";
import Header from "./Header";
import{ User} from "./User";
import {Post} from "./Post";
import {Home} from "./Home";
import {Userpost} from "./Userpost";
import {Usercomment} from "./Usercomment"


function App() {


  return (
    <BrowserRouter>
    <Header/>
    <Routes>
      <Route path="/"  element={<Home/>}/> 
      <Route path="/:postid" element={<Userpost/>}/>
      <Route path="/:postid/:commentid" element={<Usercomment/>}/>
      <Route path="/:commentid" element={<Usercomment/>}/>
      <Route path="user"  element={<User/>}/>
      <Route path="user/:postid" element={<Userpost/>}/>
      <Route path="user/:postid/:commentid" element={<Usercomment/>}/>
      <Route path="post"  element={<Post/>}/>
      <Route path="post/:commentid" element={<Usercomment/>}/>
    </Routes>
    </BrowserRouter>

  )
  }
export default App;
